import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
         <div className="row">

            <div className="nine columns main-col">

               <h2>About Me</h2>

               <div className="row">

                  <h2>Skills</h2>
                  </div>
               </div>
            </div>
      </section>
    );
  }
}
